import React from "react"


class Header extends React.Component {
    render () {
        return(
            <header>{this.props.title}</header>
        )
    }
}

class App extends React.Component {
    render () {
    return (
        <div>
            <Header title='ShapkaSayta'></Header>
            <input placeholder="asdasdsa" onMouseEnter={this.mouseEnter} onClick={this.inputClick}/>
        </div>
    )
    }

    inputClick() {console.log('clicked')}
    mouseEnter() {console.log('mouse')}
}


class Dom extends React.Component {
    render () {
        return (<input placeholder="Class: Dom" onClick={this.inputClick} onMouseEnter={this.onMouseEnter}></input>)
    }
    
    inputClick() {console.log('clicked from Dom')}
    onMouseEnter() {console.log('mouse from Dom')}

}


export default (App, Dom)
